import {FC} from 'react';
import { Routes, Route } from 'react-router-dom';

import Home from './Home/Home';

const Views : FC = () => {
    return(
        <>
            <Routes>
                <Route path="/" element={<Home/>}/>
            </Routes>
        </>
    )
}

export default Views;
